// import React from 'react';    next已经包含了
import {Button } from 'antd'
import Link from 'next/link'
import Router from 'next/router'


export default () => {

  function gotoTestB() {
    Router.push('/b')
  }
  return (
    <>
      <Link href='/a'>
        <Button>Index</Button>
      </Link> 
      <Button onClick={gotoTestB}>test b</Button>
    </>
  )
}
